MatterTitle:
Communication from the Manhattan Borough President - Pursuant to Section 197-d(b)(2) of the New York City Charter ("triple no" procedure"),
	 for the disposition of five (5) city owned properties located in Manhattan (C000294 PPM),
	 Community District 11.

Resolution approving the Fifth Amendment to the South Jamaica I Urban Renewal Plan,
	 for the South Jamaica I Urban Renewal Area,
	 approving the designation of the area and approving the decision of the City Planning Commission on ULURP No. C  010018 HUQ (L.U. No. 836).

Resolution approving the decision of the City Planning Commission on ULURP No. C  000543 PPM,
	 for disposition to the Economic Development Corporation of one (1) city-owned property located at 159 E. 126th Street (Block 1775/Lot 28),
	 Manhattan (L.U. No. 877).

Resolution approving the decision of the City Planning Commission on ULURP No. C 000675 GFM,
	 for a revocable consent to construct and maintain two informational kiosks on the sidewalk in front of the Solomon R. Guggenheim Museum located at 1071 5th Avenue on the east side of the street between 88th and 89th Streets,
	 Manhattan (L.U. No. 994).
